from sympy import factorint
def ok(n):
    f = factorint(n)
    return sum(f.values()) > 1 and sorted(bin(n)[2:]) == sorted("".join(bin(p)[2:]*f[p] for p in f))
print([k for k in range(5000) if ok(k)]) # _Michael S. Branicky_, Apr 20 2025

